import React from 'react';
import "./style.scss";

const Header = () => {
  return (
    <header className="sticky">
      <div className="header">
        <img src="/images/logo.svg" alt="" className="header__logo" />

        <nav className="cl-effect-1">
          <a href="#home" data-hover="Home">Home</a>
          <a href="#about" data-hover="About">About</a>
          <a href="#projects" data-hover="Projects">Projects</a>
          <a href="#" data-hover="Contact">Contact</a>
        </nav>
        {/* <ul className="navigation">
          <li className="navigation__item"><a href="google.com" className="navigation__link">Home</a></li>
          <li className="navigation__item"><a href="google.com" className="navigation__link">About</a></li>
          <li className="navigation__item"><a href="google.com" className="navigation__link">Projects</a></li>
          <li className="navigation__item"><a href="google.com" className="navigation__link">Contact</a></li>
        </ul> */}
      </div>
    </header>
  )
}


export default Header;
